        return new Source("{% extends 'base.html.twig' %}

{% block title %}Users index{% endblock %}
{% block stylesheets %}
<meta charset=\"utf-8\">
<meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">
<link href=\"https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css\" rel=\"stylesheet\">
<script src=\"https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/js/bootstrap.bundle.min.js\"></script>
{% endblock %}
{% block body %}

<div class=\"user-details-container\">
    <h1>Users index</h1>

    <table class=\"table table-striped table-hover\">
        <thead>
            <tr>
                <th hidden=\"hidden\"> Id</th>
                <th>Name</th>
                <th>Email</th>
                <th>Password</th>
                <th>Roles</th>
                <th>CreatedAt</th>
                <th>UpdatedAt</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td hidden=\"hidden\">{{ user.id }}</td>
                <td>{{ user.name }}</td>
                <td>{{ user.email }}</td>
                <td>{#  { { user.password } }#}</td>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
                <td>{{ user.createdAt ? user.createdAt|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ user.updatedAt ? user.updatedAt|date('Y-m-d H:i:s') : '' }}</td>
                <td>
                      <a href=\"{{ path('app_users_show', {'id': user.id}) }}\" class=\" btn btn-primary mt-3\">show</a>
                      <a href=\"{{ path('app_users_edit', {'id': user.id}) }}\" class=\" btn  btn-secondary mt-3\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"8\">no records found</td>
            </tr>
        {% endfor %}
        <tr>
            <td colspan=\"8\">    <a href=\"{{ path('app_users_new') }}\" class=\"mt-6 btn btn-primary\">Create new</a>
            </td>
        </tr>
        </tbody>
<tfoot>
<tr>
    <td></td>
</tr>
<tr>
    <td></td>

</tr>
</tfoot>
    </table>


</div>
{% endblock %}
